import styled from 'styled-components'

export const HomeContainer = styled.div`
height: 900px;
display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
background: #e5e5e5;
border-radius: 10px;

@media screen and (max-width: 768px) {
    height: 1100px;
}

@media screen and (max-width: 480px) {
    height: 1300px;
}
`
